#include<bits/stdc++.h>
using namespace std;
struct book
{
    int w;
    int num;
}a[1000+1];
int i,j,k,l,n,m,b[1000+1];
int ask(int x,int a,int y)
{
    int sz=a;
    int w=1;
    do
	{
        w*=10;
        sz--;
    }while(sz!=0);
    if((x%=w)==y)return 1;
    else return 0;
}
int main()
{
      cin>>n>>m;
      for(i=1;i<=n;i++){
          cin>>b[i];
      }
      sort(b+1,b+n+1);
      for(i=1;i<=m;i++)
	  {
          cin>>a[i].w>>a[i].num;
      }
      for(i=1;i<=m;i++)
	  {
          for(j=1;j<=n;j++)
		  {
              k+=ask(b[j],a[i].w,a[i].num);
              if(ask(b[j],a[i].w,a[i].num)==1)break;
          }
          if(k==0)cout<<"-1"<<endl;
          else cout<<b[j]<<endl;
          k=0;
      }
      return 0;
}
